import "./App.css";
import { NavBar } from "./Components/NavBar/Navbar.tsx";
import { LeftBar } from "./Components/LeftBar/LeftBar.tsx";
import { Content } from "./Components/Content/Content.tsx";
import { About } from "./Components/SecondLevelComponents/About/About";

function App() {
  return (
    <div className="App">
      <NavBar />
      <LeftBar />
      <Content />
      <About/>
    </div>
  );
}

export default App;
